import {Outlet, Link} from "react-router-dom";


const Layout=()=>
{
    return(
<>
   <div id="wrapper">
     

      <div id="topmenu">
         <ul>
            <li><span>Clofia</span></li>
            <li> <Link to="home">Men</Link> </li>
            <li> <Link to="about">Women</Link> </li>
            
           
            <li> <input type="text" id="input" placeholder="Search for items and brands" /> </li>
            <li> <Link to="about">Accoun</Link> </li>
            
         </ul>
      </div>
    
      

        
    
       <Outlet />
       
      


      <div id="footer">
        www.mycompany.com all right reserved. 2023 &copy;
      </div>


   </div>

</>
   );
}

export default Layout;
